import React, { Component, Suspense, lazy } from 'react'
import { Switch, Route, Redirect } from 'react-router-dom'

const Acceuil = lazy(() => import('./acceuil/Acceuil'))
const Dashboard = lazy(() => import('./acceuil/Dashboard'))
const FichePatient = lazy(() => import('./patient/FichePatient'))

export class AppRoutes extends Component {
  render() {
    return (
      <Suspense fallback=''>
        <Switch>
          <Route exact path="/">
            <Redirect to="/acceuil"></Redirect>
          </Route>
          <Route exact path="/acceuil" component={Acceuil} />
          <Route exact path="/dashboard" component={Dashboard} />
          <Route exact path="/patient/fiche" component={FichePatient} />
        </Switch>
      </Suspense>
    )
  }
}

